import { FC, lazy, Suspense } from "react";
import { useSelector } from "react-redux";
import { Navigate, Route, Routes } from "react-router-dom";
import TopBarProgress from "react-topbar-progress-indicator";
import { getCSSVariableValue } from "../../_metronic/assets/ts/_utils";
import { MasterLayout } from "../../_metronic/layout/MasterLayout";

import { ChungChiHanhNgheDuoc } from "../modules/apps/chung-chi-hanh-nghe/ChungChiHanhNgheDuoc";
import ChungChiHanhNghePage from "../modules/apps/chung-chi-hanh-nghe/ChungChiHanhNghePage";
import { HoiDong } from "../modules/apps/danh-muc/hoi-dong/HoiDong";
import { DanhSachHoSoChoInToChuc } from "../modules/apps/danh-sach-ho-so-cho-in-to-chuc/DanhSachHoSoChoInToChuc";
import { DanhSachHoSoChoIn } from "../modules/apps/danh-sach-ho-so-cho-in/DanhSachHoSoChoIn";
import { DanhSachHoSoPheDuyetToChuc } from "../modules/apps/danh-sach-ho-so-phe-duyet-to-chuc/DanhSachHoSoPheDuyetToChuc";
import { DanhSachHoSoPheDuyet } from "../modules/apps/danh-sach-ho-so-phe-duyet/DanhSachHoSoPheDuyet";
// import { DanhSachHoSoThuLyToChuc } from "../modules/apps/danh-sach-ho-so-thu-ly-to-chuc/DanhSachHoSoThuLyToChuc";
import { ChiTietChungChi } from "../modules/apps/danh-sach-chung-chi/ChiTietChungChi";
import { DanhSachChungChi } from "../modules/apps/danh-sach-chung-chi/DanhSachChungChi";
import { ChiTietHoSoThuLyCapMoi } from "../modules/apps/danh-sach-ho-so-thu-ly-duoc-si/ChiTietHoSoThuLyCapMoi";
import { ChiTietHoSoThuLyDuThaoCapPhep } from "../modules/apps/danh-sach-ho-so-thu-ly-duoc-si/ChiTietHoSoThuLyDuThaoCapPhep";
import { ChiTietHoSoThuLyTuChoi } from "../modules/apps/danh-sach-ho-so-thu-ly-duoc-si/ChiTietHoSoThuLyTuChoi";
import { ChiTietHoSoThuLyYeuCauBoSung } from "../modules/apps/danh-sach-ho-so-thu-ly-duoc-si/ChiTietHoSoYeuCauBoSung";
import { DanhSachHoSoThuLyDuocSi } from "../modules/apps/danh-sach-ho-so-thu-ly-duoc-si/DanhSachHoSoThuLyDuocSi";
import { LoaiMaChungChi } from "../modules/apps/loai-ma-chung-chi/LoaiMaChungChi";
import { LoaiMaGps } from "../modules/apps/loai-ma-gps/LoaiMaGPS";
import { QuanLyNguoiDung } from "../modules/apps/quan-ly-nguoi-dung/QuanLyNguoiDung";
import { ThongBao } from "../modules/apps/thong-bao/ThongBao";
import { ThongTinDaoTao } from "../modules/apps/thong-tin-dao-tao/ThongTinDaoTao";
import ThongTinDuocSi from "../modules/apps/thong-tin-duoc-si/ThongTinDuocSi";
import ThongTinToChuc from "../modules/apps/thong-tin-to-chuc/ThongTinToChuc";
import YeuCauLienKetPage from "../modules/apps/yeu-cau-lien-ket/YeuCauLienKetPage";
import { DashboardWrapper } from "../pages/dashboard/DashboardWrapper";
import { MenuTestPage } from "../pages/MenuTestPage";

import { selectCurrentUser } from "../../app/redux-module/auth/authSlice";
import { GiayPhepKinhDoanhDuoc } from "../modules/apps/giay-phep-kinh-doanh/GiayPhepKinhDoanhDuoc";

const PrivateRoutes = () => {
    const DanhMucPage = lazy(
        () => import("../modules/apps/danh-muc/DanhMucPage")
    );
    const NopHoSoPage = lazy(
        () => import("../modules/apps/nop-ho-so/NopHoSoPage")
    );

    const currentUser = useSelector(selectCurrentUser);

    return (
        <Routes>
            <Route element={<MasterLayout />}>
                {/* Redirect to Dashboard after success login/registartion */}
                <Route path="/" element={<Navigate to="/dashboard" />} />
                <Route
                    path="dang-nhap/*"
                    element={<Navigate to="/dashboard" />}
                />
                <Route
                    path="/dang-nhap"
                    element={<Navigate to="/dashboard" />}
                />

                {currentUser?.assigned_role[0]?.ten_en === "duocsi" ? (
                    <Route
                        path="/"
                        element={<Navigate to="/admin/chung-chi-hanh-nghe" />}
                    />
                ) : currentUser?.assigned_role[0]?.ten_en === "tochuc" ? (
                    <Route path="/" element={<Navigate to="/admin/giay-phep-kinh-doanh" />} />
                ) : (
                    <Route path="/" element={<Navigate to="/dashboard" />} />
                )}

                {/* Pages */}
                <Route path="dashboard" element={<DashboardWrapper />} />
                <Route path="menu-test" element={<MenuTestPage />} />
                <Route
                    path="admin/chung-chi-hanh-nghe"
                    element={<ChungChiHanhNgheDuoc />}
                />
                <Route
                    path="admin/giay-phep-kinh-doanh"
                    element={<GiayPhepKinhDoanhDuoc />}
                />

                {/* <Route path="thong-bao" element={<ThongBao />} /> */}

                <Route path="admin/danhsach-hoso-thuly-duocsi">
                    <Route path="" element={<DanhSachHoSoThuLyDuocSi />} />
                    <Route
                        path="capmoi/:id"
                        element={<ChiTietHoSoThuLyCapMoi />}
                    />
                    <Route
                        path="tuchoi/:id"
                        element={<ChiTietHoSoThuLyTuChoi />}
                    />
                    <Route
                        path="duthaocapphep/:id"
                        element={<ChiTietHoSoThuLyDuThaoCapPhep />}
                    />
                    <Route
                        path="yeucaubosung/:id"
                        element={<ChiTietHoSoThuLyYeuCauBoSung />}
                    />
                </Route>

                {/* <Route
          path="admin/danhsach-hoso-thuly-duocsi"
          element={<DanhSachHoSoThuLyDuocSi />}
        /> */}
                {/* <Route
          path="admin/danhsach-hoso-thuly-tochuc"
          element={<DanhSachHoSoThuLyToChuc />}
        /> */}
                <Route
                    path="admin/danhsach-hoso-pheduyet-duocsi"
                    element={<DanhSachHoSoPheDuyet />}
                />
                <Route
                    path="admin/danhsach-hoso-pheduyet-tochuc"
                    element={<DanhSachHoSoPheDuyetToChuc />}
                />
                <Route
                    path="admin/danhsach-hoso-choin-duocsi"
                    element={<DanhSachHoSoChoIn />}
                />
                <Route
                    path="admin/danhsach-hoso-choin-tochuc"
                    element={<DanhSachHoSoChoInToChuc />}
                />
                <Route
                    path="admin/loai-ma-chung-chi"
                    element={<LoaiMaChungChi />}
                />
                <Route path="admin/danhsach-hoidong" element={<HoiDong />} />
                <Route path="admin/loai-ma-gps" element={<LoaiMaGps />} />
                <Route
                    path="admin/thong-tin-dao-tao"
                    element={<ThongTinDaoTao />}
                />
                {/* Lazy Modules */}
                <Route
                    path="admin/danh-muc/*"
                    element={
                        <SuspensedView>
                            <DanhMucPage />
                        </SuspensedView>
                    }
                />
                <Route
                    path="admin/nop-ho-so/*"
                    element={
                        <SuspensedView>
                            <NopHoSoPage />
                        </SuspensedView>
                    }
                />
                <Route
                    path="admin/chung-chi-hanh-nghe/*"
                    element={
                        <SuspensedView>
                            <ChungChiHanhNghePage />
                        </SuspensedView>
                    }
                />
                <Route
                    path="admin/danh-sach-chung-chi/*"
                    element={
                        <SuspensedView>
                            <DanhSachChungChi />
                        </SuspensedView>
                    }
                />
                <Route
                    path="admin/danh-sach-chung-chi/chi-tiet/:id"
                    element={
                        <SuspensedView>
                            <ChiTietChungChi />
                        </SuspensedView>
                    }
                />
                <Route
                    path="admin/*"
                    element={
                        <SuspensedView>
                            <YeuCauLienKetPage />
                        </SuspensedView>
                    }
                />
                <Route
                    path="chung-chi-hanh-nghe"
                    element={<ChungChiHanhNgheDuoc />}
                />
                <Route path="thong-bao" element={<ThongBao />} />
                <Route path="thong-tin-duoc-si" element={<ThongTinDuocSi />} />
                <Route path="thong-tin-to-chuc" element={<ThongTinToChuc />} />
                <Route
                    path="quan-ly-nguoi-dung"
                    element={<QuanLyNguoiDung />}
                />

                {/* Page Not Found */}
                <Route path="*" element={<Navigate to="/error/404" />} />
                {/* <Route path="error/404" element={<PageNotFound />} />
        <Route path="error/403" element={<Accessdenied />} /> */}
            </Route>
        </Routes>
    );
};

const SuspensedView: FC = ({ children }) => {
    const baseColor = getCSSVariableValue("--bs-primary");
    TopBarProgress.config({
        barColors: {
            "0": baseColor,
        },
        barThickness: 1,
        shadowBlur: 5,
    });
    return <Suspense fallback={<TopBarProgress />}>{children}</Suspense>;
};

export { PrivateRoutes };
